    false,nt"url": null,nt"notes": "This annual narrative report for Squaw
    Creek NWR outlines Refuge accomplishments during the 1989 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    public participation, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, manpower programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grasslands, haying, fire management, pest
    control, and wilderness areas. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, scientific collections, animal control, and disease
    control. The public uses of the Refuge described in this report include hunting,
    fishing, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, communication systems,
    and computer systems. Cooperative programs and items of interest are provided at
    the end. Refuge brochures, field guides, and a report titled "The Breeding Status,
    Relative Abundance and Habitat Associations of Birds Occurring on National Wildlife
    Refuges and Other Selected Areas" are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
